// config view Engine
viewEngine(app);

// config webRoutes
webRoutes(app);

app.use(bodyParser.json());
app.use(bodyParser.urlencoded({extended: true}));

let port = process.env.PORT || 8080

app.listen(port, () => {
    console.log("App is running at the port: ", port)
})

